import React from 'react'
import download from '../layout/download.png'
const Home = () => {
  return (

      <div className="row home-content">
        <p className="">
          Stack Overflow is a question and answer site <br />for professional and enthusiast<br /> programmers.
          It is a privately held website, the flagship <br />site of the Stack Exchange <br />Network.
        </p>
        <div className="row">
      <img src={download} className="home-image" alt="logo" />

      </div>
      </div>

  )
}

export default Home;
